import React from 'react';

const Year = (props) => {
    return (
        <div className="input-container">
            <input type="number" maxLength="4"
            value={props.year} onChange={props.handleChange}
            name="year" placeholder="Must be 4 digits"
            className="offer-input" />    
        </div>
    )
}

export default Year


